Following the emperor's demise, Yuukei's aunt was chosen to be the empress. On her orders, his family was to be killed. With the help of a doctor and a young girl, he alone is able to escape. Entering into town, he meets a girl named Meimei who gives him refuge. However, she is to head into the inner palace.

&quot;Why don't you come with me?&quot;

Thus, Yuukei enters into the inner palace disguised as a girl. However, his identity is doubted by a eunuch. With his knowledge and companions as his means of resistance, trials assail him one after another. In an excessively irrational world, will Yuukei be able to pull through? A masterful Chinese fantasy.

When I opened my eyes after a fire, I became a side character in a novel. What am I to do now?

Get closer to the heroine? No. 
Get closer to the male lead? No.
I&rsquo;m going to live a long and simple life!

I&rsquo;ve lived peacefully outside the Emperor&rsquo;s castle for 3 years. I thought I would be free as long as the novel ended happily as it should.

&ldquo;Who&rsquo;s th-...&rdquo;
&ldquo;Servant.&rdquo;

Huh?

&ldquo;I&rsquo;ll listen to your every command.&rdquo;
&ldquo;H-Huh?&rdquo;
&ldquo;If I listen to whatever you say, can we live together?&rdquo;

The servant who came into my easy life.
I live a happy life with him. Sometimes he&rsquo;s a kind servant, and other times, a dear friend&hellip;The problem is, I can&rsquo;t seem to take my eyes off him when he smiles saucily and flirtatiously with those red eyes.
...Is it because of my feelings?

The 30th concubine, Lydia, whose goal is to live a long and simple life and the suspicious servant begin a strange relationship as they start living together.

I was reincarnated as a supporting character in a novel. And on top of that, I had the role of a &lsquo;magpie bridge&rsquo; inside the romance story &lt;Hestia&rsquo;s Boys&gt;.

Anyways, romance was impossible, and my future seemed bleak with my debt-riddled family. After becoming a civil servant, I tried to enjoy the wealth and honor I couldn&rsquo;t have in my past life, but&hellip; Unlike the originals, the male characters seem kind of strange?!

&ldquo;Imagine, how would Char-Char look blushing and shy while looking at someone she likes?&rdquo;
&ldquo;Wow&hellip;.. that&rsquo;d be amazing.&rdquo;
Keurigord gets blank-stared, Hylli wants to talk whenever we see each other, and Yves wears an expression and mutters to himself.
&ldquo;Should I take you and run away&hellip;.&rdquo;
Sean would cover his face with both hands without saying anything. His blush used to only reach his face but now the red spreads to the tip of his ears.

Why are you guys not obsessing over the female lead and doing other stuff instead?

Charine West, who wanted to live a normal life, and her survival at Char-Char&rsquo;s reverse harem.

Cheol has a crush on his math teacher. His feelings for her aren't the innocent kind of love a student could have for his teacher..
His meticulous and premeditated plan to make her fall for him begins!
&quot;My Teacher.. She's my girl.&quot;

This content has many provocative scenes. Please watch your back when reading.&nbsp;

Seo Yi-Hwan, the youngest son of a conglomerate. He, with a close friend, who's a world-renowned pianist have enjoyed dangerous times committing themselves to promiscuous parties and drugs together. But soon, the walls of trust they've built slowly begins to crack as the mysterious girl, Yoo Se-Rin appears in the lives of the two men.

Who is this new mysterious girl?

Fia, who is aiming to be a knight in a family of knights, remembers her previous life as a &quot;Grand Saint&quot; when she was on the verge of dying. The saint is currently a highly important and respected profession because and is on the verge of extinction! The holy power she can use happens to be the &quot;lost magic&quot; of myths.

In her previous life, she was threatened by the right arm of the Demon King, saying, &quot;I'll kill you again if you're reborn as a saint.&quot;

&quot;If I use such power, I wonder if I would be caught and killed once again&hellip;&quot;

Watch as she tries to live a simple life as a knight, hiding the fact that she's a Grand Saint!
