Betraying my tyrant elder brother by helping the abducted male protagonist to escape, I was just a short-lived insect in a supporting role.

In the original story, I was bewitched to help the male protagonist escape&hellip;
Original? Who cares about that? First of all, I would not live if I did it.

So I decided to talk with the unfamiliar scary elder brother whom I never know when he would kill me. I mean, I tried&hellip;

&ldquo;You dare to touch my younger sister without fear, take responsibility. Take your pick. Imprisonment, exile, execution. If you can&rsquo;t choose, you may do all three.&rdquo;

&hellip;You don&rsquo;t have to twist it?
Why is this elder brother suddenly like this?

&ldquo;I don&rsquo;t want to go back. Princess Clara is here.&rdquo;

Why is the male protagonist also like this? You have to go and become the emperor!

Jaekyung, who has a hard time forming deep relationships with people, takes charge of the remodeling project for an amusement park and hotel enterprise.
While taking a look around the park to gain a better understanding for the project, he comes across lighthearted Taehee who is dressed as a bear mascot, and is drawn to him despite not wanting to be.
Taehee approaches the typically detached Jaekyung, and proposes a no-strings-attached relationship for the two to enjoy. However&hellip;

I remember the story of a novel I had read in my previous life just before my marriage. If you don&rsquo;t mess up the wedding, you&rsquo;ll be poisoned by your husband! So I just kissed the pastor who was in charge of the ceremony.

&quot;Commander, are you alright?&quot;
One of the holy knights shouted as he approached the pastor who was kissed.
Huh, what?
Wait... are you the commander of the Holy Knights?

****

Rurutia, who was about to die, wanted to spend her last moment in a temple where she felt at ease the most. She started a business with her friends for the temple, and itwas a big hit.
&quot;Miss, you have the world in the palm of your hands!&quot;
&quot;Are you a God who descended to earth?&quot;
In the midst of being embarrassed by the large crown, the commander of the holy knights himself was also acting strange.

&ldquo;All I wish for is to be your husband.&rdquo;
He said that with eyes shining with obsession.
&quot;Take responsibility for stealing my first kiss.&quot;

This is all so wrong.
It seems that I changed my future.

If you want to protect your country, you'll have to assassinate the emperor of the enemy country.

Emperor Lan of the Northern Kites had plans to send a woman of wisdom, courage, and beauty as a princess to take down the emperor of the enemy country&hellip;

But the woman the enemy emperor wanted was none other than the haughty and impudent&hellip;

Lan hides her identity and became a princess to directly assassinate the enemy emperor, Orhan.

If you take off the checkered shirt and thick rimmed glasses on his head, you get a handsome and young blond man?! The nerdy Ethan fell in love with Dwayne at their high school prom. With no progress for 4 years, Ethan reunites with Dwayne in his graduation party. Dwayne, ignoring Ethan who had mustered up his courage to go talk to him, feels something hard graze his hand as he walks past the nerdy boy. This guy has something amazing&hellip;!

&quot;You.. Do you wanna do something fun with me?&quot;

What will happen to the nerdy boy, Ethan?

Beneath the Overworld, in the Underground Empire Jeojeojeo, the 17th Great King suddenly declares that they are leaving the throne. A contest is announced and the winner will get to be the new Great King. A Rank-A prisoner, the dethroned half prince named Jet, follows his father's command and participates in this contest but...

&quot;What? To be the great king I have to protect that loser?!&quot; 

That is the &quot;Token&quot;. Jet needs to protect it in the fierce competition of the Underground people, where each person has to protect a &quot;Prince's Token&quot;.

The day she woke up after a two-year coma, Layla heard that her engagement to the crown prince has been called off. Not only is he already engaged to Layla's little sister, Rose, but she&rsquo;s pregnant with his child&hellip;

[i]Was it for nothing that I had to endure my strict upbringing?[/i]

A legendary sorcerer will be waiting for Layla when she escapes her life. But, the crown prince, who was supposed to have broken off the engagement, is still holding on to her?!

The villain was reincarnated as an extra in a novel where all the soul was sucked to death. What would you do if you were reborn at best? 18 years of living as a slave after being mistreated by his family. Just as the original did, the parents succeeded in running away, just before they were forcibly sold to the villain. Also, I had a small but happy time with Momo, an organic dog I met in a rural village. But three months later, the dog that took care of his pampering disappeared! They are caught by their families and are dedicated to villains. The moment I was discouraged that I had a rusting death, &ldquo;Why are you so surprised? It's me, your puppy Momo.&rdquo;
