&ldquo;Die for us, just like you&rsquo;ve served our family all along.&rdquo;

Because of her crimson eyes and the dark splotch on her face, Arryl Brixia, the illegitimate child of the Brixia ducal house, had to live with a mask on her entire life. She tried desperately to win the acceptance of her family, but in the end, she met her death after being framed for treason.

But now, she&rsquo;s returned to the past. She can no longer see the hideous splotch in her reflection in the mirror. But her face isn&rsquo;t the only thing that&rsquo;s changed from before &mdash; Ethan, the heir to the Burstein ducal family, suddenly comes and finds her&hellip;

&ldquo;Lady Arryl, why do you wear a mask?&rdquo;
&ldquo;Why do you ask?&rdquo;
&ldquo;Your eyes.&rdquo;
&ldquo;What?&rdquo;
&ldquo;I saw your eyes. Your clear and confident eyes.&rdquo;
&ldquo;People fear them because they believe it&rsquo;s the sign of the devil. Don&rsquo;t you think so, Sir Ethan?&rdquo;
&ldquo;No, not at all. They look absolutely beautiful to me.&rdquo;

The satisfying revenge story of Lady Arryl Brixia, who was abandoned by her own family.
